/************************** CONFIG SECTION **************************/

function getAccount(){
	return 	localStorage.getItem('_TRACKING_ACCOUNT')?localStorage.getItem('_TRACKING_ACCOUNT'):typeof _dlayer==='object'&&typeof _dlayer.s_account ==='string'?_dlayer.s_account:window.location.hostname.search(/^(www\.)?vigo\.de$/i)===-1?"aokdev":"aokvigode";
}
s_account=getAccount();


var s=new AppMeasurement();
s.account=s_account;
s.cookieLifetime=2*365*86400 // Cookie lifetime in seconds
s.currencyCode="EUR"
s.charSet="UTF-8"
s.trackingServer="anonym.aok.de"
s.trackingServerSecure="anonym.aok.de"
s.visitorNamespace="aok"

/* Link Tracking Config */
s.trackDownloadLinks=true
s.trackExternalLinks=true
s.trackInlineStats=false
s.linkDownloadFileTypes="exe,zip,wav,mp3,mov,mpg,avi,wmv,pdf,doc,docx,xls,xlsx,ppt,pptx,ics"
s.linkInternalFilters="javascript:,vigo.de"
s.linkLeaveQueryString=false
s.linkTrackVars="events,channel,hier1,server,eVar8,eVar9,eVar31,eVar32"
s.linkTrackEvents="event21,event22"

/* Plugin Config */
// timeparting config variables
s.dstdate=new Date();
s.dstY=s.dstdate.getFullYear();
s.dst_start = new Date("March 24, "+s.dstY+" 02:00:00");
s.dst_end = new Date("October 24, "+s.dstY+" 02:00:00");
s.tpday = s.dst_start.getDay();
s.dst_start.setDate(31-s.tpday);
s.tpday = s.dst_end.getDay();
s.dst_end.setDate(31-s.tpday);
s.dstStart=(s.dst_start.getMonth()+1) + '/' + s.dst_start.getDate() + '/' + s.dstY;
s.dstEnd=(s.dst_end.getMonth()+1) + '/' + s.dst_end.getDate() + '/' + s.dstY;
s.currentYear=s.dstY;

// marketing channel
s.brandedKeywordList="vigo"; // tbd
s._channelDomain='Social|facebook.com,linkedin.com,twitter.com,xing.com>AOK Portal|aok.de';
s._channelParameter="Campaign|cid";
s._channelPattern="Paid Search|gog>Banner|ban>Newsletter|nlt";
s._cvpchannel="";

// plugin
s.usePlugins=true
s.loadDoPlugins=true
function s_doPlugins(s) {

    if( ! _twt.go ){ s.abort = true; }

    /* Add calls to plugins here */
    if( s.loadDoPlugins ) {
        if (s.pageType=="errorPage") s.pageName="";
        s.eVar7=s.getNewRepeat(30,'s_nrv');
        s.prop8=s.getTimeParting("h","+1");
        s.eVar1=s.prop8;
        s.prop9=s.getTimeParting("d","+1");
        s.eVar2=s.prop9;
        s.prop10=s.getTimeParting("w","+1");
        s.eVar3=s.prop10;
        s.prop11=s.getDaysSinceLastVisit('s_lv');
        s.eVar4=s.prop11;
        s.eVar8=s.pageName;
        s.eVar9 = 'D=g'; // Current URL
        s.eVar30=s.Util.getQueryParam('lid'); // internal campaign

        //s.eVar11=s.campaign=s.Util.getQueryParam('cid');
        s.campaign=s.Util.getQueryParam('cid');
        if(s.campaign){ s.campaign=s.campaign.replace(/\#.*/i, ''); s.eVar11=s.campaign }
        if(s.eVar11){ s.events=s.apl( s.events, 'event11', ',', 1 ) }
        var s_campaign=s.getAndPersistValue(s.campaign,'sc_perscmp',0);
        s.campaign=s.getValOnce(s.campaign,'s_campaignid',7);
        if(s_campaign){
            s.prop13=s.pageName + "|" + s_campaign;
            s.eVar5="D=c13";
            s._cvpchannel="cid-campaign";
        }
        // Google ValueTrack
        s.eVar17=s.Util.getQueryParam("kw");
        s.eVar17=s.getValOnce(s.eVar17,"sc_v17",0);
        s.eVar18=s.Util.getQueryParam("nw");
        s.eVar18=s.getValOnce(s.eVar18,"sc_v18",0);
        s.eVar19=s.Util.getQueryParam("ap");
        s.eVar19=s.getValOnce(s.eVar19,"sc_v19",0);
        s.eVar20=s.Util.getQueryParam("mt");
        s.eVar20=s.getValOnce(s.eVar20,"sc_v20",0);

        // marketing channel
        s.channelManager('cid',',','s_cm',0,'s_dl');
        if (typeof (s._channel) != "undefined" && s._channel != "") {
            if (s._keywords=="Keyword Unavailable"){ s._keywords="kwu"; }
            if (s._channel=="Natural Search"){ s._campaign='seo_'+s._partner+':'+s._keywords; s._cvpchannel='seo_'+s._partner; }
            if (s._campaign=="" && s._channel=="Social"){ s._cvpchannel=s._campaign="soc_"+s._referringDomain; }
            if (s._channel.indexOf("eferrers")!=-1){ s._cvpchannel=s._campaign="ref_"+s._referringDomain; }
            if (s._channel=="Typed/Bookmarked"){ s._cvpchannel=s._campaign="direct"; }
            s.eVar12=s._campaign;
            s.eVar13=s.crossVisitParticipation(s.eVar12,'s_v13','90','10','>','',1);
            s.eVar15=s.crossVisitParticipation(s._cvpchannel,'s_v15','90','10','>','',1);
            if (s._channel=="SEA" && s.inList(s._keywords, s.brandedKeywordList, ',', 1, 1)) {
                s._channel=s._channel+' Brand';
            }
            s.eVar14=s.getValOnce(s._channel,"s_cm_ch",0);
            s.eVar16=s.getValOnce(s._keywords,"s_cm_kw",0);
        }
        s.loadDoPlugins=false;
        s.plugins="";
    }

    if( s.linkType == "d" ){
        s.events=s.apl(s.events,'event21',',',1);
        s.eVar31=s.linkURL;
    } else if( s.linkType == "e" ){
        s.events=s.apl(s.events,'event22',',',1);
        s.eVar32=s.linkURL;
    }
}
s.doPlugins=s_doPlugins
